import { BrowserRouter } from "react-router-dom";
import FloatingLabelInput from "./components/atoms/InputText/FloatingLabelInput";
import InputPass from "./components/atoms/InputWithIcon/InputPass";
import Button from "./components/atoms/Button/Button";
import Modal from "./components/atoms/Modal/Modal";
import React, { useState } from "react";

function App() {
  const [isOpen, setIsOpen] = useState(false);

  const handleClose = () => {
    setIsOpen(false);
  };

  return (
    <BrowserRouter>
      <div>
        <FloatingLabelInput
          labelText="Email"
          placeholderText="email@email.com"
        />
        <InputPass placeholderText="Password" />
        <br />
        <Button text={"LOG IN"} onClick={() => console.log("click")} />
        <div>
          <button onClick={() => setIsOpen(true)}>Open Modal</button>
          <Modal isOpen={isOpen} onClose={handleClose}>
            <h1>Modal Content</h1>
          </Modal>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
